  state = {
    user: {},
    users: [],
    numberOfUsers: 0
  }

  createUser = () => {
    const user = {
      email: "ahmgo@gmail.com",
      pasword: "b200gd"
    }
    axios.post('http://localhost:3080/server/newuser', user)
            .then(res => {
              console.log(res.data)
              console.log(res.message)
            });
  }

  getAllUsers = () => {
    getAllUsers()
      .then(users => {
        console.log(users)
        this.setState({users: users["data"], numberOfUsers: users["data"].length})
      });
  }

